  //ฟังก์ชัน FPSTR ไม่สามารถใช้กับไฟล์ไบนารีไฟล์ได้ ซึ่งได้แก่ ไฟล์รูปภาพต่าง เช่น .jpg .png .gif เป็นต้น เนื่องจากในไฟล์เหล่านั้นมีข้อมูล 0x00 อยู่ภายในไฟล์
  //ซึ่งข้อมลูค่านี้ โปรแกรมจะเข้าใจว่านั่นคือรหัสสิ้นสุดไฟล์ ดังนั้นจึงไม่สามารถใช้ฟังก์ชั้นดังกล่าว อ่านไฟล์ไบนารีใน PROGMEM ได้
  //วิธีการแก้ไขคือ ระบุขนาดของไฟล์ที่จะอ่านด้วยตนเอง


  String content = FPSTR(index_php);
