  content.replace("{maxT}", String(maxThotle));
  content.replace("{startUp}", String(startupThotle));
  content.replace("{motorPin}", String(motor_pin));
  content.replace("{switchPin}", String(swtch_pin));


  if (switchMode == 0) {
    content.replace("{0}", "selected");
    content.replace("{1}", "");
  } else {
    content.replace("{0}", "");
    content.replace("{1}", "selected");
  }

  digitalWrite(2, !digitalRead(2));
  //Serial.println("Test "+content);

  content.replace("<?php include('footer.php'); ?>", FPSTR(footer_php));
  //content.replace("<?php echo \"<script>\"; include('js/customscript.js'); echo \"</script>\"; ?>","<script>{script}</script>");
  //content.replace("{script}",FPSTR(customscript_js));
  webServer.send(200, "text/html", content);
